import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { FaArrowLeft, FaDownload, FaChartLine, FaUsers, FaUtensils, FaMoneyBillWave } from 'react-icons/fa';
import './ReportsManagement.css';

const ReportsManagement = ({ onBack }) => {
  const [insights, setInsights] = useState({
    overview: {
      totalOrders: 0,
      totalRevenue: 0,
      averageOrderValue: 0,
      totalCustomers: 0,
    },
    menuInsights: {
      topDishes: [],
      mealTypeDistribution: { Lunch: 0, Dinner: 0 },
      foodTypeDistribution: { Veg: 0, 'Non-veg': 0 },
    },
    orderInsights: {
      recentOrders: [],
      orderStatusDistribution: {},
      orderTrends: [],
    },
    customerInsights: {
      newCustomers: 0,
      repeatCustomers: 0,
      topCustomers: [],
    },
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [dateRange, setDateRange] = useState('week');

  useEffect(() => {
    fetchInsights();
  }, [dateRange]);

  const fetchInsights = async () => {
    try {
      setLoading(true);
      const token = localStorage.getItem('token');
      if (!token) throw new Error('Authentication token not found');

      const response = await axios.get(
        `http://localhost:5002/api/reports?range=${dateRange}`,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
          },
        }
      );

      const data = response.data || {};
      setInsights({
        overview: {
          totalOrders: data.totalOrders || 0,
          totalRevenue: data.totalRevenue || 0,
          averageOrderValue: data.totalOrders
            ? data.totalRevenue / data.totalOrders
            : 0,
          totalCustomers: data.totalCustomers || 0,
        },
        menuInsights: {
          topDishes: Array.isArray(data.popularItems)
            ? data.popularItems.map((item) => ({
                name: item.name || 'Unknown Item',
                orderCount: item.orderCount || 0,
              }))
            : [],
          mealTypeDistribution: data.mealTypeDistribution || {
            Lunch: 0,
            Dinner: 0,
          },
          foodTypeDistribution: data.foodTypeDistribution || {
            Veg: 0,
            'Non-veg': 0,
          },
        },
        orderInsights: {
          recentOrders: Array.isArray(data.recentOrders)
            ? data.recentOrders.map((order) => ({
                orderId: order.orderId || 'N/A',
                total: order.total || 0,
                date: order.date || new Date(),
              }))
            : [],
          orderStatusDistribution: data.statusDistribution || {},
          orderTrends: data.orderTrends || [],
        },
        customerInsights: {
          newCustomers: data.newCustomers || 0,
          repeatCustomers: data.repeatCustomers || 0,
          topCustomers: Array.isArray(data.topCustomers)
            ? data.topCustomers.map((customer) => ({
                name: customer.name || 'Unknown',
                totalSpent: customer.totalSpent || 0,
              }))
            : [],
        },
      });

      setError(null);
    } catch (err) {
      console.error('Error fetching insights:', err);
      setError(
        err.response?.data?.message ||
          err.message ||
          'Failed to fetch insights. Please try again later.'
      );
      setInsights({
        overview: {
          totalOrders: 0,
          totalRevenue: 0,
          averageOrderValue: 0,
          totalCustomers: 0,
        },
        menuInsights: {
          topDishes: [],
          mealTypeDistribution: { Lunch: 0, Dinner: 0 },
          foodTypeDistribution: { Veg: 0, 'Non-veg': 0 },
        },
        orderInsights: {
          recentOrders: [],
          orderStatusDistribution: {},
          orderTrends: [],
        },
        customerInsights: {
          newCustomers: 0,
          repeatCustomers: 0,
          topCustomers: [],
        },
      });
    } finally {
      setLoading(false);
    }
  };

  const handleExport = async () => {
    try {
      const token = localStorage.getItem('token');
      if (!token) throw new Error('Authentication token not found');

      const response = await axios.get(
        `http://localhost:5002/api/reports?range=${dateRange}&export=true`,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
          },
          responseType: 'blob',
        }
      );

      if (!response.data) throw new Error('No data received for export');

      const url = window.URL.createObjectURL(new Blob([response.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', `business-insights-${dateRange}.pdf`);
      document.body.appendChild(link);
      link.click();
      link.remove();
      window.URL.revokeObjectURL(url);
    } catch (err) {
      console.error('Error exporting report:', err);
      setError(
        err.response?.data?.message ||
          err.message ||
          'Failed to export report. Please try again later.'
      );
    }
  };

  if (loading) return <div className="loading">Loading insights...</div>;

  return (
    <div className="reports-container">
      {/* Rest of your JSX remains unchanged */}
    </div>
  );
};

export default ReportsManagement;
